  return (
    <section id="faq">
      <div className="container faq">
        <div className="u-title">
          <BsFillBookmarkStarFill color="orangered" size={30} />
          <h2 className="u-title-h2">FAQs</h2>
          <p className="u-text-small u-text-dark">
            Lorem ipsum dolor sit amet consectetur adipisicing elit.
            Dignissimos, amet nostrum! Tempore odio magnam praesentium cum dolor
            corporis, laborum ipsam! Nobis pariatur obcaecati, saepe odit
            quibusdam aspernatur ipsum enim eum esse consequatur debitis quae.
          </p>
        </div>
      </div>
    </section>
  );
}

export default Faq
